THANK YOU FOR WATCHING IN A DREAM LIVE IF YOU DID🙇🏻‍♂️😅This EP is hard to listen to, think about, perform. It’s been a rough year 😙✌🏼. Butttt moving through it and expressing it in this way has been very therapeutic for me. The best team ever whipped this together w such open minds, collaboration, and ambition. in Melbourne!! On film!! I’m real proud of it 🧡 thank you TO:
